/*************** Some useful quartics ***************/

 function InvariantsQuarticChar7(f)

     a0:= Coefficient(f, 0); a1:= Coefficient(f, 1);
     a2:= Coefficient(f, 2); a3:= Coefficient(f, 3);
     a4:= Coefficient(f, 4);

     return [ a0*a4 + 5*a1*a3 + 3*a2^2,
	      a0*a2*a4 + 4*a0*a3^2 + 4*a1^2*a4 + a1*a2*a3 + 6*a2^3 ],
	    [2, 3];

 end function;


 function QuarticCovChar7(f, numero)

     a0:= Coefficient(f, 0); a1:= Coefficient(f, 1);
     a2:= Coefficient(f, 2); a3:= Coefficient(f, 3);
     a4:= Coefficient(f, 4); a5:= Coefficient(f, 5);
     a6:= Coefficient(f, 6); a7:= Coefficient(f, 7);
     a8:= Coefficient(f, 8);

     x:= Parent(f).1;

     if numero eq 1 then
	 return a6*x^4 + 3*a5*x^3 + 6*a4*x^2 + 3*a3*x + a2;
     elif numero eq 2 then
	 return (6*a5^2 + a4*a6)*x^4 + (2*a4*a5 + 5*a3*a6)*x^3 + (4*a4^2 + 2*a3*a5 + a2*a6)*x^2
		+ (2*a3*a4 + 5*a2*a5)*x + 6*a3^2 + a2*a4;
     else
	 return (3*a4^2*a5^2 + 3*a3*a5^3 + 6*a4^3*a6 + 3*a2*a5^2*a6 + 3*a1*a5*a6^2 + 3*a0*a6^3 +
		 3*a3^2*a5*a7 + 6*a2*a4*a5*a7 + 6*a1*a5^2*a7 + a2*a3*a6*a7 + a1*a4*a6*a7 +
		 3*a3^2*a4*a8 + 6*a2*a4^2*a8 + a2*a3*a5*a8 + a0*a5^2*a8 + 6*a0*a4*a6*a8)*x^4
		+ (3*a3*a4*a5^2 + 6*a2*a5^3 + 6*a3*a4^2*a6 + 6*a3^2*a5*a6 + a2*a4*a5*a6 +
		   2*a1*a5^2*a6 + 2*a2*a3*a6^2 + 2*a0*a5*a6^2 + a3^2*a4*a7 + 2*a2*a4^2*a7 +
		   2*a1*a4*a5*a7 + 6*a2^2*a6*a7 + 5*a1*a3*a6*a7 + a3^3*a8 + 2*a2*a3*a4*a8 +
		   6*a2^2*a5*a8 + 5*a0*a4*a5*a8 + 2*a0*a3*a6*a8)*x^3
		+ (6*a3^2*a5^2 + a2*a4*a5^2 + 3*a1*a5^3 + a3^2*a4*a6 + a2*a4^2*a6 + 6*a2*a3*a5*a6 +
		   3*a1*a4*a5*a6 + 5*a2^2*a6^2 + 5*a1*a3*a6^2 + 4*a0*a4*a6^2 + 3*a3^3*a7 +
		   3*a2*a3*a4*a7 + 4*a1*a4^2*a7 + 5*a2^2*a5*a7 + 2*a1*a3*a5*a7 + a1*a2*a6*a7 +
		   4*a2^2*a4*a8 + 3*a0*a4^2*a8 + 5*a0*a3*a5*a8 + 6*a0*a2*a6*a8)*x^2
		+ (3*a3^2*a4*a5 + 6*a2*a4^2*a5 + 6*a2*a3*a5^2 + a1*a4*a5^2 + a0*a5^3 +
		   6*a3^3*a6 + a2*a3*a4*a6 + 2*a1*a4^2*a6 + 2*a2^2*a5*a6 + 2*a0*a4*a5*a6 +
		   6*a1*a2*a6^2 + 6*a0*a3*a6^2 + 2*a2*a3^2*a7 + 2*a1*a3*a4*a7 + 5*a1*a2*a5*a7 +
		   2*a2^2*a3*a8 + 5*a0*a3*a4*a8 + 2*a0*a2*a5*a8)*x
		+ 3*a3^2*a4^2 + 6*a2*a4^3 + 3*a3^3*a5 + 3*a1*a3*a5^2 + 3*a0*a4*a5^2 + 3*a2*a3^2*a6 + 6*a1*a3*a4*a6 +
		6*a0*a4^2*a6 + a1*a2*a5*a6 + a0*a3*a5*a6 + 3*a2^2*a3*a7 + 6*a1*a3^2*a7 +
		a1*a2*a4*a7 + 3*a2^3*a8 + a0*a3^2*a8 + 6*a0*a2*a4*a8;

     end if;

 end function;

/*************** Reconstruction ***************/

/* Case C2xPGL(2, 7) :
     y^2 = x^7 - x.
*/
function G3Models_C2xPGL(JI : geometric:= false)

    FF:= Universe(JI); x:= PolynomialRing(FF).1;
    f:= x^7 - x;
    if geometric then return [f]; end if;
    return HyperellipticPolynomialTwists(f, 8);

end function;


/* Case C2xD4 :
     y^2 = x^8 + a*x^4 + 1,
     5*J2^7 + J14 = J2^2 + J4 = 0 (Discrim = 0),
     see [MaShShVo2002].
*/
function G3Models_C2xD4(JI : geometric:= false)

    FF:= Universe(JI); x:= PolynomialRing(FF).1;
    J2, J3, J4:= Explode(JI);

    if J2 ne 0  then
	a:= 6*J3/J2;
	b:= (6*a*J3 + 3*J4)/J2;
    else
	error "[models_char7] C2xPGL case trapped in G3Models_C2xD4 by error at JI = ", JI;
    end if;

    f:= x^8 + a*x^4 + b;
    if geometric then return [f]; end if;
    return HyperellipticPolynomialTwists(f, 8);

end function;


/* Case D6 :
     y^2 = x*(x^6 + a*x^3 + 1)
     4*J2^2 + J4 = 4*J2^7 + J14 = 0 (Discrim = 0),
     see [MaShShVo2002].
*/

function G3Models_D6(JI : geometric:= false)

    FF:= Universe(JI); x:= PolynomialRing(FF).1;
    J2, J3, J4:= Explode(JI);

    if J2 ne 0 and J3 ne 0 then
	a:= 6*J3/J2;
	b:= (3*a*J4 + 3*J2*J3)/J3;
    else
	error "[models_char7] C2xPGL case trapped in G3Models_D6 by error at JI = ", JI;
    end if;

    f:= x^7+ a*x^4 + b*x;
    if geometric then return [f]; end if;
    return HyperellipticPolynomialTwists(f, 8);

end function;


/* Case C2xC4 :
     y^2 = a^2*x^8 + 2*a^2*x^6 + 2*a*x^2 +2,
     2*J2^2 + J4 = J2^7 + J14 = 0 or 3*J2^2 + J4 = 3*J2^7 + J14 = 0 (Discrim = 0),
     see [MaShShVo2002].
*/
function G3Models_C2xC4(JI : geometric:= false)

    FF:= Universe(JI); x:= PolynomialRing(FF).1;
    J2, J3, J4, J5, J6, J7, J8, J9, J10:= Explode(JI);

    if J2 eq 0 then
	error "[models_char7] G672 case trapped in G3Models_C2xC4 by error at JI = ", JI;
    elif J4 + 3*J2^2 ne 0 then
	a:= (3*J4*J2^2 + 2*J2^4) / (J4 + 3*J2^2)^2;
	f:= a^2*x^8 + 2*a^2*x^6 + a*x^2 + 5;
    else
	f:= x*(x^2-1)*(x^2+1)^2; //singular case
    end if;

    if geometric then return [f]; end if;
    return HyperellipticPolynomialTwists(f, 8);

end function;


/* Case C2^3 :
     y^2 = a0*x^8 + a2*x^6 + a4*x^4 + a2*x^2 + a0,
     J2^4 + 5*J2^2*J4 + 3*J3*J5 + 2*J2*J6 + J8 = 0 and
     5*J2^3*J3 + J3^3 + 6*J2*J3*J4 + J2^2*J5 + 3*J3*J6 + 4*J2*J7 + J9 = 0 and
     5*J2^7 + 6*J2^4*J3^2 + 6*J2*J3^4 + 3*J2^5*J4 + 2*J2^2*J3^2*J4 + J2^3*J3*J5 + 3*J3^3*J5
       + 2*J2^4*J6 + 2*J2*J3^2*J6 + 2*J2^2*J3*J7 + J14 = 0 (Discrim = 0),
     see [MaShShVo2002].
*/

function G3Models_C2x3(JI : geometric:= false, descent:= true)

    FF:= Universe(JI); x:= PolynomialRing(FF).1;
    J2, J3, J4, J5, J6, J7:= Explode(JI);

    /* Case where the automorphism group is larger (C2xD4). */
    if 3*J2^3 + J3^2 eq 0 then
	error "[models_char7] C2xD4 case trapped in G3Models_C2x3 by error at JI = ", JI;
    end if;

    Pa4:= (3*J2^3 + J3^2)*x^3 +
	  (4*J2*J3^2 + 2*J2^2*J4 + 2*J4^2 + 6*J3*J5 + 6*J2*J6)*x +
	  2*J3^3 + 6*J2*J3*J4 + 6*J2^2*J5 + 2*J4*J5 + 4*J3*J6 + J2*J7;

    if not IsIrreducible(Pa4) then
	/* Easy, we may find a rational model in this case */
	a4:= [r[1] : r in Roots(Pa4)][1];
	a2:= 4*a4^2 + 5*J2;
	if a2 eq 0 then
	    error "[models_char7, ann] C2xD4 case trapped in G3Models_C2x3 by error at JI = ", JI;
	end if;
	if 2*a4*(3*J2^3 + J3^2) + J2^2*J3 + J3*J4 + J2*J5 eq 0 then
	    a0:= 0;
	else
	    a0:= - ( 3*a2^3*J4 + a2^2*a4*(3*a4*J4+J5) + 4*a2^5 + 2*a2^3*a4^4 + a2^2*a4^6 ) / (2*a4*(3*J2^3 + J3^2) + J2^2*J3 + J3*J4 + J2*J5);
	end if;
	l:= 1/a2;
	f:= a0*x^8 + a2*x^6 + a4*x^4 + l*a2*x^2 + l^2*a0;
	if geometric then return [f]; end if;
	return HyperellipticPolynomialTwists(f, 8);

    else /* Let's go in a degree 3 extension */

	Pa4 /:= Coefficient(Pa4, Degree(Pa4));
	if IsFinite(FF) then K3:= ext<FF | Pa4>; else K3:= quo<Parent(x) | Pa4>; end if;
	a4:= K3.1; x:= PolynomialRing(K3).1;
	a2:= 4*a4^2 + 5*J2;
	if a2 eq 0 then
	    error "[models_char7, ann] C2xD4 case trapped in G3Models_C2x3 by error at JI = ", JI;
	end if;
	if 2*a4*(3*J2^3 + J3^2) + J2^2*J3 + J3*J4 + J2*J5 eq 0 then
	    a0:= 0;
	else
	    a0:= - (3*a2^3*J4 + a2^2*a4*(3*a4*J4+J5) + 4*a2^5 + 2*a2^3*a4^4 + a2^2*a4^6) / (2*a4*(3*J2^3 + J3^2) + J2^2*J3 + J3*J4 + J2*J5);
	end if;
	l:= 1/a2;

	fK3:= a0*x^8 + a2*x^6 + a4*x^4 + l*a2*x^2 + l^2*a0;

	if Discriminant(fK3) eq 0 then return [fK3]; end if;

	/* Descent on FF with covariant method */
	if descent then
	    CK3:= QuarticCovChar7(fK3, 1); IK3, JK3:= Explode(InvariantsQuarticChar7(CK3));
	    if IK3 eq 0 or JK3 eq 0 or 4*IK3^3 + 4*JK3^2 eq 0 then CK3:= QuarticCovChar7(fK3, 2); IK3, JK3:= Explode(InvariantsQuarticChar7(CK3)); end if;
	    if IK3 eq 0 or JK3 eq 0 or 4*IK3^3 + 4*JK3^2 eq 0 then CK3:= QuarticCovChar7(fK3, 3); IK3, JK3:= Explode(InvariantsQuarticChar7(CK3)); end if;
	    if IK3 eq 0 or JK3 eq 0 or 4*IK3^3 + 4*JK3^2 eq 0 then
		error "[models_char3] C2xD4 case trapped in G3Char3Models_C2x3 by error at JI = ", JI;
	    end if;

         if IsEmpty(Roots(CK3)) then
	        fact:= Factorisation(CK3)[1,1];
		if IsFinite(FF) then KC:= ext<K3 | fact>;
		else KC:= quo<Parent(x) | fact>; end if;
		x:= PolynomialRing(KC).1;
	    end if;

	    if IK3 ne 0 then
		k2:= x^3 + 3*IK3^3/JK3^2*x + 2*IK3^3/JK3^2;
	    else
		k2:=  x^3 + 3*x^2 + 3*x;
	    end if;

	    ret, ML:= IsGL2Equivalent(Parent(x)!CK3, k2, 4);

	    f:= MActOnC(Parent(x)!fK3, 8, Matrix(2, 2, ML[1]));
	    f:= f/LeadingCoefficient(f);
	    f:= PolynomialRing(FF)!Eltseq(f);
        else
	    f:= fK3;
 	end if;

	if geometric then return [f]; end if;
	return HyperellipticPolynomialTwists(f, 8);

    end if;

end function;






function G3Char7Models(JI: geometric:= false, models:= true, descent:= true)

    FF:= Universe(JI);
    J2, J3, J4, J5, J6, J7, J8, J9, J10, J11, J13, J14, J15:= Explode(JI);
    p:= Characteristic(FF);
    twists:= [];

    /* Point at infinity*/
    if J2 eq 0 and J3 eq 0 and
       J4 eq 0 and J5 eq 0 and
       J6 eq 0 and J7 eq 0 and
       J8 eq 0 and J9 eq 0 and
       J10 eq 0 and J11 eq 0 and
       J13 eq 0 and J14 eq 0 and
       J15 eq 0 then

	aut:= SmallGroup(1,1);/* FixMe: <1,1> is not the good choice here */
	if models then twists:= [PolynomialRing(FF).1^8]; end if;
	if geometric or not models then return twists, aut; end if;
	error "[models_char7] no possible twist computations for singular forms, sorry";
	return [], <>;
    end if;


     /*** Zero dimensional cases ***/

     /* G672 : y^2 = x^7 - x  */
     if J2 eq 0 and J3 eq 0 and J4 eq 0 and J5 eq 0 and J6 eq 0 and J7 eq 0 and J8 eq 0
	and J9 eq 0 and J10 eq 0 and J11 eq 0 and J13 eq 0 and J15 eq 0 then
	 vprintf G3Twists, 1 : "Automorphism group G672, curve y^2 = x^7 - x\n";
	 aut:= SmallGroup(672, 1043);
	 if models then twists:= G3Models_C2xPGL(JI : geometric:= geometric); end if;
	 return twists, aut;
     end if;

     /*** One dimensional cases ***/

     /* C2 x D4 : y^2 = x^8 + a*x^4 + 1 or a*x^8 + a*x^4 + b*/
     if  6*J2^13*J4 + 2*J2^12*J6 + J2^11*J8 + J2^10*J10 + J2^8*J4*J10 + 6*J2^5*J6*J14 + 3*J2^4*J8*J14 + 5*J2^3*J10*J14 + 4*J2*J4*J10*J14 + J15^2 eq 0 and
	 5*J2^14 + 6*J2^12*J4 + 4*J2^11*J6 + 2*J2^10*J8 + 3*J2^9*J10 + 2*J2^7*J4*J10 + 6*J2^6*J6*J10 + 2*J2^7*J14
	 + J2^5*J4*J14 + 6*J2^4*J6*J14 + 2*J2^2*J10*J14 + J13*J15 eq 0 and
	 2*J2^13 + J2^11*J4 + 3*J2^9*J8 + 3*J2^8*J10 + J2^6*J4*J10 + 5*J2^5*J6*J10 + J13^2 + 4*J2^4*J4*J14 + 5*J2^3*J6*J14 + 6*J2^2*J8*J14 eq 0 and
	 5*J2^13 + J2^11*J4 + J2^10*J6 + J2^6*J4*J10 + J2^5*J6*J10 + 3*J2^6*J14 + 4*J2^4*J4*J14 + J2^2*J8*J14 + J11*J15 eq 0 and
	 4*J2^11*J3 + 6*J2^10*J5 + 5*J2^9*J7 + 5*J2^8*J9 + 5*J2^6*J13 + 3*J2^4*J3*J14 + 4*J2^3*J5*J14 + J2^2*J7*J14 + 4*J2*J9*J14 + J10*J15 eq 0 and
	 J2^12 + 3*J2^10*J4 + 5*J2^8*J8 + 4*J2^7*J10 + 6*J2^5*J4*J10 + J2^4*J6*J10 + J11*J13 + J2^5*J14 + 2*J2^3*J4*J14 + J2^2*J6*J14 eq 0 and
	 3*J2^12 + 5*J2^10*J4 + 5*J2^9*J6 + 2*J2^8*J8 + 4*J2^7*J10 + J2^5*J4*J10 + 6*J2^4*J6*J10 + 3*J2^5*J14 + J2^3*J4*J14 + 5*J2^2*J6*J14 + J9*J15 eq 0 and
	 2*J2^10*J3 + 6*J2^9*J5 + 4*J2^8*J7 + 5*J2^7*J9 + 6*J2^6*J11 + J2^5*J13 + J10*J13 + 2*J2^3*J3*J14 + 4*J2^2*J5*J14 + 2*J2*J7*J14 + 4*J2^4*J15 eq 0 and
	 J2^10*J3 + 3*J2^9*J5 + 2*J2^8*J7 + 2*J2^7*J9 + 4*J2^6*J11 + 4*J2^3*J3*J14 + 2*J2^2*J5*J14 + 3*J2*J7*J14 + 2*J2^4*J15 + J8*J15 eq 0 and
	 3*J2^11 + 5*J2^9*J4 + 4*J2^8*J6 + J2^7*J8 + 5*J2^6*J10 + 5*J2^4*J4*J10 + 2*J2^3*J6*J10 + J11^2 + 6*J2^2*J4*J14 eq 0 and
	 5*J2^11 + 3*J2^9*J4 + 3*J2^8*J6 + J2^7*J8 + 2*J2^6*J10 + 5*J2^4*J4*J10 + 4*J2^3*J6*J10 + J9*J13 + 4*J2^4*J14 + 5*J2^2*J4*J14 eq 0 and
	 4*J2^11 + 6*J2^9*J4 + 2*J2^8*J6 + 5*J2^7*J8 + 6*J2^6*J10 + J2^4*J4*J10 + 2*J2^3*J6*J10 + 6*J2^4*J14 + 3*J2^2*J4*J14 + J7*J15 eq 0 and
	 3*J2^9*J3 + 5*J2^8*J5 + J2^6*J9 + 2*J2^5*J11 + J10*J11 + 2*J2^4*J13 + J2^2*J3*J14 + J2*J5*J14 + 2*J2^3*J15 eq 0 and
	 5*J2^9*J3 + J2^8*J5 + 3*J2^7*J7 + 5*J2^6*J9 + 5*J2^5*J11 + 3*J2^4*J13 + J8*J13 + 2*J2^2*J3*J14 + 2*J2*J5*J14 + 2*J2^3*J15 eq 0 and
	 5*J2^9*J3 + 3*J2^8*J5 + 6*J2^7*J7 + 6*J2^6*J9 + 2*J2^5*J11 + J2^4*J13 + 4*J2^2*J3*J14 + 2*J2*J5*J14 + J6*J15 eq 0 and
	 3*J2^10 + 6*J2^8*J4 + 6*J2^7*J6 + 5*J2^6*J8 + 6*J2^5*J10 + 6*J2^3*J4*J10 + 5*J2^2*J6*J10 + J10^2 + 3*J2*J4*J14 eq 0 and
	 6*J2^10 + 6*J2^8*J4 + 6*J2^7*J6 + 5*J2^6*J8 + J2^5*J10 + 2*J2^3*J4*J10 + 3*J2^2*J6*J10 + J9*J11 + J2^3*J14 eq 0 and
	 5*J2^10 + 4*J2^8*J4 + 3*J2^7*J6 + 2*J2^6*J8 + 2*J2^5*J10 + J2^3*J4*J10 + 6*J2^2*J6*J10 + J7*J13 + 5*J2^3*J14 eq 0 and
	 4*J2^10 + 5*J2^8*J4 + 2*J2^7*J6 + 2*J2^6*J8 + 2*J2^5*J10 + 6*J2^3*J4*J10 + 6*J2^2*J6*J10 + 4*J2^3*J14 + J5*J15 eq 0 and
	 4*J2^8*J3 + 5*J2^7*J5 + J2^6*J7 + J9*J10 + 4*J2^4*J11 + 4*J2^3*J13 + J2*J3*J14 + J2^2*J15 eq 0 and
	 5*J2^8*J3 + 6*J2^7*J5 + 3*J2^6*J7 + 2*J2^5*J9 + 6*J2^4*J11 + J8*J11 + 6*J2^3*J13 + J2*J3*J14 + 3*J2^2*J15 eq 0 and
	 2*J2^8*J3 + 3*J2^7*J5 + 6*J2^6*J7 + J2^5*J9 + 2*J2^4*J11 + 6*J2^3*J13 + J6*J13 + 6*J2*J3*J14 + 4*J2^2*J15 eq 0 and
	 5*J2^8*J3 + 6*J2^6*J7 + 4*J2^5*J9 + 6*J2^4*J11 + 6*J2*J3*J14 + 4*J2^2*J15 + J4*J15 eq 0 and
	 2*J2^7*J4 + 4*J2^6*J6 + J2^5*J8 + J9^2 + 2*J2^4*J10 + 3*J2^2*J4*J10 + 4*J2*J6*J10 eq 0 and
