	4*J2^7*J3 + 4*J2^4*J3^3 + 4*J2*J3^5 + 6*J2^2*J3^3*J4 + 6*J2^3*J3*J4^2 + 6*J3^3*J4^2 +
        2*J2*J3*J4^3 + 2*J2^6*J5 + 5*J2^3*J3^2*J5 + 6*J3^4*J5 + 2*J2^4*J4*J5 + 2*J2^2*J4^2*J5
        + J2^2*J3*J5^2 + 4*J2^4*J3*J6 + 6*J2*J3^3*J6 + 5*J3*J4^2*J6 + 3*J2*J3*J6^2 + 5*J2^5*J7
        + 6*J2^2*J3^2*J7 + 4*J3^2*J4*J7 + 6*J2*J4^2*J7 + 2*J2*J3*J5*J7 + 5*J2^3*J3*J8 +
        4*J3^3*J8 + 4*J2*J3*J4*J8 + 5*J2^2*J5*J8 + 4*J3*J6*J8 + J2^4*J9 + 3*J2*J3^2*J9 +
        6*J2^2*J4*J9 + J4^2*J9 + J3*J5*J9 + 3*J2*J6*J9 + J8*J9 + J2^2*J3*J10 + J3*J4*J10 +
        2*J2*J5*J10 + 3*J7*J10 + 2*J2^3*J11 + J3^2*J11 + 5*J2*J4*J11 + 5*J6*J11 + 2*J2^2*J13 +
        J2*J15 eq 0 and
	4*J2^8 + J2^5*J3^2 + 4*J2^2*J3^4 + J2^6*J4 + 3*J2^3*J3^2*J4 + 3*J3^4*J4 + 2*J2^4*J4^2 +
        2*J2*J3^2*J4^2 + 6*J2^2*J4^3 + J4^4 + J2^4*J3*J5 + 6*J2*J3^3*J5 + 5*J2^2*J3*J4*J5 +
        J3*J4^2*J5 + 4*J2^3*J5^2 + 2*J3^2*J5^2 + 4*J2*J4*J5^2 + 4*J2^5*J6 + 5*J2^2*J3^2*J6 +
        4*J3^2*J4*J6 + 3*J2*J4^2*J6 + J2^2*J6^2 + 6*J4*J6^2 + J2^3*J3*J7 + 3*J3^3*J7 +
        J2*J3*J4*J7 + 5*J2^2*J5*J7 + J4*J5*J7 + 2*J2^4*J8 + 3*J2*J3^2*J8 + 6*J2^2*J4*J8 +
