        J3^2*J10 + 5*J2*J4*J10 + 2*J5*J11 + 2*J3*J13 eq 0 and
	6*J2^6*J3 + 4*J2^3*J3^3 + 3*J2^4*J3*J4 + 3*J2^2*J3*J4^2 + 3*J3*J4^3 + 4*J2^5*J5 +
