        + 5*J2^2*J4*J5 + J2^2*J3*J6 + 6*J3*J4*J6 + 6*J2^3*J7 + 3*J3^2*J7 + J2*J4*J7 + J6*J7 +
        5*J2*J3*J8 + 4*J2^2*J9 + 2*J4*J9 + 3*J3*J10 + 6*J2*J11 eq 0 and
